import React from "react";

const Star = ({ value, req, color }) => {
  console.log(color);
  return (
    <span>
      <i
        class={
          value >= 1 + req
            ? "fa-solid fa-star"
            : value >= 0.5 + req
            ? "fa-regular fa-star-half-stroke"
            : "fa-regular fa-star"
        }
      ></i>
    </span>
  );
};

